description:
a mass overproduction. Flush with wealth, the Once-ler rationalized his short sighted greed into an arrogant self-righteousness that even co-opts the helpless protests of the Lorax for his own ends. As a result, he completely depleted the forest while making the region uninhabitable with his business' pollution. With that, the Once-ler was left ruined and abandoned by his family and became a recluse with the creation and isolation of Ted's town that came under Mr. O'Hare's control. Eventually, the Lorax sends the wildlife (and the Once-ler's horse) away before departing himself, leaving a stonecut word, &quot;Unless.&quot;



